import { Component } from "react";

// import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
        },
        {
          name: "Frank",
        },
        {
          name: "Jackie",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {Object.values(this.state).forEach((name) => {
          return <h1>{name}</h1>;
        })}
        <h1>{this.state.monster1.name}</h1>
      </div>
    );
  }
}

export default App;
